import React, { useState } from 'react';
import './Settings.css';

const Settings = () => {
  const [profile, setProfile] = useState({
    name: '',
    email: '',
    password: '',
  });

  const [notifications, setNotifications] = useState({
    emailNotifications: true,
    smsNotifications: false,
  });

  const [generalSettings, setGeneralSettings] = useState({
    timezone: 'GMT',
    language: 'English',
  });

  const [securitySettings, setSecuritySettings] = useState({
    twoFactorAuth: false,
    securityQuestions: false,
  });

  const [theme, setTheme] = useState({
    darkMode: false,
  });

  const handleProfileChange = (e) => {
    const { name, value } = e.target;
    setProfile({ ...profile, [name]: value });
  };

  const handleNotificationsChange = (e) => {
    const { name, checked } = e.target;
    setNotifications({ ...notifications, [name]: checked });
  };

  const handleGeneralSettingsChange = (e) => {
    const { name, value } = e.target;
    setGeneralSettings({ ...generalSettings, [name]: value });
  };

  const handleSecuritySettingsChange = (e) => {
    const { name, checked } = e.target;
    setSecuritySettings({ ...securitySettings, [name]: checked });
  };

  const handleThemeChange = (e) => {
    const { name, checked } = e.target;
    setTheme({ ...theme, [name]: checked });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Profile Updated:', profile);
    console.log('Notifications Updated:', notifications);
    console.log('General Settings Updated:', generalSettings);
    console.log('Security Settings Updated:', securitySettings);
    console.log('Theme Settings Updated:', theme);
  };

  return (
    <div className="settings">
      <h1>Settings</h1>
      <form onSubmit={handleSubmit}>
        <div className="settings-section">
          <h2>Profile Settings</h2>
          <input
            type="text"
            name="name"
            value={profile.name}
            onChange={handleProfileChange}
            placeholder="Name"
            className="settings-input"
          />
          <input
            type="email"
            name="email"
            value={profile.email}
            onChange={handleProfileChange}
            placeholder="Email"
            className="settings-input"
          />
          <input
            type="password"
            name="password"
            value={profile.password}
            onChange={handleProfileChange}
            placeholder="Password"
            className="settings-input"
          />
        </div>

        <div className="settings-section">
          <h2>Notification Settings</h2>
          <label className="settings-label">
            <input
              type="checkbox"
              name="emailNotifications"
              checked={notifications.emailNotifications}
              onChange={handleNotificationsChange}
            />
            Enable Email Notifications
          </label>
          <label className="settings-label">
            <input
              type="checkbox"
              name="smsNotifications"
              checked={notifications.smsNotifications}
              onChange={handleNotificationsChange}
            />
            Enable SMS Notifications
          </label>
        </div>

        <div className="settings-section">
          <h2>General Settings</h2>
          <label className="settings-label">
            Timezone:
            <select
              name="timezone"
              value={generalSettings.timezone}
              onChange={handleGeneralSettingsChange}
              className="settings-select"
            >
              <option value="GMT">GMT</option>
              <option value="EST">EST</option>
              <option value="PST">PST</option>
              <option value="IST">IST</option>
            </select>
          </label>

          <label className="settings-label">
            Language:
            <select
              name="language"
              value={generalSettings.language}
              onChange={handleGeneralSettingsChange}
              className="settings-select"
            >
              <option value="English">English</option>
              <option value="Spanish">Spanish</option>
              <option value="French">French</option>
              <option value="German">German</option>
            </select>
          </label>
        </div>

        <div className="settings-section">
          <h2>Security Settings</h2>
          <label className="settings-label">
            <input
              type="checkbox"
              name="twoFactorAuth"
              checked={securitySettings.twoFactorAuth}
              onChange={handleSecuritySettingsChange}
            />
            Enable Two-Factor Authentication
          </label>
          <label className="settings-label">
            <input
              type="checkbox"
              name="securityQuestions"
              checked={securitySettings.securityQuestions}
              onChange={handleSecuritySettingsChange}
            />
            Enable Security Questions
          </label>
        </div>

        <div className="settings-section">
          <h2>Theme Settings</h2>
          <label className="settings-label">
            <input
              type="checkbox"
              name="darkMode"
              checked={theme.darkMode}
              onChange={handleThemeChange}
            />
            Enable Dark Mode
          </label>
        </div>

        <button type="submit" className="settings-button">Save Changes</button>
      </form>
    </div>
  );
};

export default Settings;
